import React from "react";

function Card ({ src, title, description, price}) {
    return(
        <div className="card">
            <img src={src} alt="" />
            <div className="card_info">
                <h2>{title}</h2>
                <h4>{description}</h4>
                <h3>{price}</h3>
            </div>
        </div>
    )
}

export default Card
